import { Component } from '@angular/core';
import { PhotoDto } from 'src/app/models/photo.model';

@Component({
  selector: 'app-feed',
  templateUrl: './feed.component.html',
  styleUrls: ['./feed.component.css']
})
export class FeedComponent {
  photos: Array<PhotoDto>= new Array<PhotoDto>;

  ngOnInit (){
    debugger;
    this.photos.push(new PhotoDto(this.image0)); 
    this.photos.push(new PhotoDto(this.image1)); 
    this.photos.push(new PhotoDto(this.image2));  
  }

  image0: string = 'data:image/jpeg;base64,';
  image1: string = 'data:image/jpeg;base64,';
  image2: string = 'data:image/jpeg;base64,';
}
